  text-align: center;
  padding: 2vh;
  border-width: 1px;
  border-color: #0A6466;
  font-family: Gilroy;
  font-weight: normal;
  color: #0A6466;
  font-size: 2.2vh;
  border-top-style: solid;
  border-bottom-style: solid;
  border-spacing:0;
`;

const RequestStatus = styled.span`
  padding: 0.25vh;
  border-radius: 1px;
  width: 8vw;
  color: #9CD0B7;
  background-color: #DEF1E8;
  text-align: center;
`;
class Request extends Component {
    render() {
        return (
            <>
                <RequestRow>
                    <RequestColumn>2005222223INFO140</RequestColumn>
                    <RequestColumn>20 mai 2022</RequestColumn>
                    <RequestColumn>Salle 140</RequestColumn>
                    <RequestColumn>Matériel</RequestColumn>
                    <RequestColumn>Haut-parleurs</RequestColumn>
                    <RequestColumn>
                        <div className="validate_status">
                            <div className="validate_icon">
                                <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 48 48">
                                    <path d="M18.95 35.1 8.45 24.55 10.05 22.95 18.95 31.85 37.9 12.85 39.55 14.5Z"/>
                                </svg>
                            </div>
                            <div className="validate_text">
                                Validé
                            </div>
                        </div>
                    </RequestColumn>
                    <RequestColumn>
                        <a href="#" className="button_cancel">
                            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 48 48">
                                <path
                                    d="M12.55 37.05 10.95 35.45 22.4 24 10.95 12.55 12.55 10.95 24 22.4 35.45 10.95 37.05 12.55 25.6 24 37.05 35.45 35.45 37.05 24 25.6Z"/>
                            </svg>
                        </a>
                    </RequestColumn>
                </RequestRow>
            </>
        );
    }
}

export default Request;
